@EU_Commission @Bundeskanzler @OlafScholz what a stupid country you are...

Ukraine agreed to buy from Germany Marder infantry fighting vehicles, Gepard anti-aircraft guns, and self-propelled artillery.

Chancellor Olaf Scholz blocks all of it.

@EU_Commission @OlafScholz Taking care of refugees isn't enough for the largest country in the EU.
Slovakia could send heavy equipment, the Balts could cut off the gas. Germany is doing everything to increase the number of refugees and deaths.
Face your responsibility and consequences of your policy.
